import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from "react-bootstrap/Form";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import Offcanvas from "react-bootstrap/Offcanvas";
import "../styling/navbar.css";

export const NavBar = () => {
  return (
    <div className="navbar-container">
      <Navbar expand="md" className="bg-body-tertiary mb-3">
        <Container fluid>
          <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-md`} />
          <Navbar.Brand href="#">thenujastore</Navbar.Brand>
          <Navbar.Offcanvas
            id={`offcanvasNavbar-expand-md`}
            aria-labelledby={`offcanvasNavbarLabel-expand-md`}
            placement="start"
          >
            <Offcanvas.Header closeButton>
              <Offcanvas.Title id={`offcanvasNavbarLabel-expand-md`}>
                thenujastore
              </Offcanvas.Title>
            </Offcanvas.Header>
            <Offcanvas.Body>
              <Nav className="justify-content-end flex-grow-1 pe-3 top-nav">
                <Nav.Link className="main-link" href="#action1">HOME</Nav.Link>
                <Nav.Link className="main-link" href="#action2">NEW ARRIVALS</Nav.Link>
                <Nav.Link className="main-link" href="#action2">SHOP</Nav.Link>
                <NavDropdown eventKey={1} title="Item 1">
                            <MenuItem eventKey={1.1} href="#">Item 1.1</MenuItem>
                        </NavDropdown>
                <Nav.Link className="main-link" href="#action2">COLLECTIONS</Nav.Link>
              </Nav>
              <Nav className="justify-content-end flex-grow-1 pe-3 bottom-nav">
                <Nav.Link className="other-link" href="#action1">Search</Nav.Link>
                <Nav.Link className="other-link" href="#action2">FAQ</Nav.Link>
                <Nav.Link className="other-link" href="#action2">Privacy Policy</Nav.Link>
                <Nav.Link className="other-link" href="#action2">Contact Us</Nav.Link>
              </Nav>
            </Offcanvas.Body>
          </Navbar.Offcanvas>
        </Container>
      </Navbar>
    </div>
  );
};
